        return 0
    if n >= 10:
        return 1
    st = set()
    for ch in S:
        st.add(ch)
    size = len(st)
    if size > 3:
        return 1
    elif size == 3 and n >= 5:
        return 1
    elif size != 2 and n >= 7:
        return 1
    else:
